description:
28 may 2012

Dewey Cocks is a musical icon and revered the world over. But things didn't always work out for Dewey. Back in the old days, all he wanted to do was play an instrument. The only problem was, he was fucking terrible. But when he learned his gift was actually his singing voice, his life took off from there. It was raining bitches for Mr. Cocks and here's one story of how he got it on in a threesome with two of his groupies - Jessica Jaymes and Tiffany Brookes. 

